NO CONTEST to the charge in count 1, burglary - building or dwelling as repeater.  Convicted.
State moves to dismiss and read in counts 2-5.  Motion granted.
Defendant is sentenced to the Wisconsin State Prison System for a total of seven (7) years.  That's three (3) years initial confinement followed by four (4) years extended supervision.  This sentence to run concurrent to any sentence presently being served.
Conditions of Extended Supervision: 
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) Pay $1,000 restitution to Big Apple Pub and Grill (to be paid first);
3) Pay $3,709 to Society Insurance (to be paid second);
4) Maintain fulltime employment, schooling, work search, treatment or combination;
5) Pay court costs;
6) Pay supervision fees in an amount to be determined by DOC;
7) Provide DNA sample.
Defendant has credit for 115 days.
Court finds the defendant is eligible for both the Substance Abuse Program and the Challenge Incarceration Program.
Minutes.
